features.script:
const door = parcel.getFeatureById('sDoorFrame1');
const glass = parcel.getFeatureById('sGlassDoor1');
const glassRight = parcel.getFeatureById('sGlassDoor2');
const doorRight = parcel.getFeatureById('sDoorFrame2');
const speed = 0.1
const movementRate = 50
const waitTime = 3000
const totalMoves = 20
let closed = true;

feature.on('click', (e) => {
  if (closed) {
      start(0)
    closed = false  
   }  
})

door.on('click', (e) => {
  if (closed) {
      start(0)
    closed = false  
   }  
})
glass.on('click', (e) => {
  if (closed) {
      start(0)
    closed = false  
   }  
})
doorRight.on('click', (e) => {
  if (closed) {
      start(0)
    closed = false  
   }  
})
glassRight.on('click', (e) => {
  if (closed) {
      start(0)
    closed = false  
   }  
})

function start(counter){
  if(counter < totalMoves){
    setTimeout(function(){
      counter++;
      door.position.x -= speed
      glass.position.x -= speed
      glassRight.position.x += speed
      doorRight.position.x += speed
      start(counter);
    }, movementRate);
  }
  if(counter == totalMoves) {
    setTimeout(function(){
      goBack(counter)  
    }, waitTime)  

  }
}

function goBack(counter) {
  if(counter > 0){
    setTimeout(function(){
      counter--;
      door.position.x += speed
      glass.position.x += speed
      glassRight.position.x -= speed
      doorRight.position.x -= speed
      goBack(counter);
    }, movementRate);
  } else {
    closed = true
  }
}
